import {Link, Route, Router, Routes} from "react-router-dom";
import Game from "./components/Game";
function App() {
  return<Router>
    <nav>
      <Link to = '/' >home</Link>
    </nav>

    <Routes>
      <Route path='/' element=<Game/> />
    </Routes>

  </Router>;
}

export default App;
